import Foundation
import UIKit

extension UIImage {
    class func returnImageBase64() -> UIImage {
        let dataDecoded = NSData(base64Encoded: "", options: NSData.Base64DecodingOptions(rawValue: 0))!
        
        let decodedimage:UIImage = UIImage(data: dataDecoded as Data)!
        return decodedimage
    }
}


